import React from 'react'

function Watchprop( {Icon, tittle}) {
    return (
        <div style={{display:'flex',justifyContent:'space-between',alignItems:"center",height:"10vh",width:'10vw',backgroundColor:'green',}}>
            <Icon size="20px"/>
            <h3>{tittle}</h3>
        </div>
    )
}

export default Watchprop
